import CsvUpload from './CsvUpload'
import React, { useState } from 'react'


const Entry = () => {
    const [myData, setMyData] = useState({})

    const convertToObject = (anArray) => {
        let objectArray = []

        anArray.forEach(game => {
            const myGame = {}
            for (let i = 0; i < anArray[0].length; i++) {
                myGame[anArray[i]] = game[i]
            }
            objectArray.push(myGame)
        })

        console.log(objectArray)
    }
    return(
        <div>
        Hi
        <CsvUpload setMyData = {setMyData}/>

        {myData.map}
        </div>
    )
}

export default Entry
